DELIMITER $$
CREATE TRIGGER `update_request_closed_date` BEFORE UPDATE ON `service_request` FOR EACH ROW BEGIN
    -- Check if status is being changed to "Complete"
    -- and request_closed date is not already set
    IF NEW.request_status = 'Complete' 
       AND (OLD.request_status != 'Complete' OR OLD.request_status IS NULL)
       AND NEW.request_closed IS NULL THEN
        SET NEW.request_closed = CURRENT_DATE();
    END IF;
END
$$
DELIMITER ;

